  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for submerged aquatic vegetation (SAV) in the Bristol Bay Subarea.
  The Subarea includes marine and coastal areas of Bristol Bay and part of the southern
  Alaska Peninsula. (This area extends from directly south of Goodnews Bay to slightly
  north of Port Seniavan along the Bristol Bay side of the Alaska Peninsula, as well
  as the Pacific Ocean side of the Alaska Peninsula from Cape Providence to Kupreanof
  Peninsula.) Vector polygons in this data set represent eelgrass and kelp distribution.
  Species-specific abundance, seasonality, status, life history, and source information
  are stored in relational data tables (described below) designed to be used in conjunction
  with this spatial data layer.This data set comprises a portion of the Environmental
  Sensitivity Index (ESI) data for the Bristol Bay Subarea. ESI data characterize
  the marine and coastal environments and wildlife by their sensitivity to spilled
  oil. The ESI data include information for three main components: shoreline habitats,
  sensitive biological resources, and human-use resources.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
